import './Recommendation.css';

import { Col, Container, Row } from "react-bootstrap";

function Recommendation(){

    const ArraysOfRecommendation = [{}];
    const ArrayOfRecommendationOnMap = ArraysOfRecommendation((ArrayOfRecommendation) => 
    <Col lg = "2" md = "4" sm = "6">
        <img src = {ArrayOfRecommendation.image} className = "w-100"/>

        <h2>{ArrayOfRecommendation.title}</h2>
    </Col>
    )

    return(
        <Container>
            <hr/>
            <small className = "recommend-title">
                <span>Recommended</span>
            </small>
            <Row>
                {ArrayOfRecommendationOnMap}
            </Row>
        </Container>
    )
}

export default Recommendation;
